Policy CS25 Built and Historic Environment
Development proposals will be expected to contribute positively to the character of the built and historic environment of the Borough. The character of the built and historic environment will be protected, preserved or enhanced. Particular protection will be given to the character and special features of:
a) Conservation areas;
b) Listed buildings;
c) Historic parks and gardens;
d) Archaeological sites; and
e) The historic landscape of the Eston Hills. Development which preserves or, where appropriate, enhances the character of important historic buildings and sites and their settings will be encouraged.

Policy CS24 Biodiversity and Geological Conservation
The Borough's biodiversity and geological resource will be protected and enhanced. Priority will be given to:
a) Protection of the integrity of the European sites in and near the Borough.
b) Conserving and enhancing protected biodiversity and geodiversity sites and features in line with PPS9;
c) Improving the integrity and biodiversity value of wildlife corridors particularly along the coast, around the Teesmouth estuary and linking with the North York Moors;
d) Meeting the objectives and targets in the UK and Tees Valley Biodiversity Action Plan;
e) Encouraging management of landscape belts for nature conservation;
f) Protecting ancient woodland and veteran trees;
g) Strengthening populations of protected and target species; and
h) Improving site management and increasing public access to wildlife sites. Development will be encouraged to include measures to contribute positively to the overall biodiversity in the Borough.
